	    a.depth = (a.height - 0.2) * 0.75;

	    var t = makeSpan(
	        ["t"], [buildCommon.mathsym("T", group.mode)], options);
	    var e = makeSpan(
	        ["e"], [buildCommon.mathsym("E", group.mode)], options);

	    e.height = (e.height - 0.2155);
	    e.depth = (e.depth + 0.2155);

